import React from "react";
import { motion } from "framer-motion";
import "./.css";

// Sample node + edge data (simplified lion face structure)
const nodes = [
  { id: 1, x: 0, y: -200, color: "purple" }, // top
  { id: 2, x: -150, y: -150, color: "red" },
  { id: 3, x: 150, y: -150, color: "blue" },
  { id: 4, x: -200, y: 0, color: "red" },
  { id: 5, x: 200, y: 0, color: "blue" },
  { id: 6, x: -150, y: 150, color: "purple" },
  { id: 7, x: 150, y: 150, color: "purple" },
  { id: 8, x: 0, y: 200, color: "purple" },
  // Face / inner black dots
  { id: 9, x: -50, y: -50, color: "black" },
  { id: 10, x: 50, y: -50, color: "black" },
  { id: 11, x: -30, y: 20, color: "black" },
  { id: 12, x: 30, y: 20, color: "black" },
  { id: 13, x: 0, y: 70, color: "black" },
];

const edges = [
  [1, 2], [1, 3],
  [2, 4], [3, 5],
  [4, 6], [5, 7],
  [6, 8], [7, 8],
  [9, 11], [10, 12],
  [11, 13], [12, 13],
  [9, 10],
];

export default function LionGraph() {
  return (
    <div className="lion-container">
      <svg width="600" height="600" viewBox="-300 -300 600 600">
        {/* Draw edges */}
        {edges.map(([from, to], i) => {
          const n1 = nodes.find(n => n.id === from);
          const n2 = nodes.find(n => n.id === to);
          return (
            <line
              key={i}
              x1={n1.x}
              y1={n1.y}
              x2={n2.x}
              y2={n2.y}
              stroke="black"
              strokeWidth="1"
              strokeDasharray="2,3"
              opacity="0.6"
            />
          );
        })}

        {/* Draw nodes */}
        {nodes.map((n, i) => (
          <motion.circle
            key={i}
            cx={n.x}
            cy={n.y}
            r={8}
            fill={n.color}
            animate={{
              r: [6, 10, 6],
              opacity: [0.7, 1, 0.7],
            }}
            transition={{
              duration: 2,
              repeat: Infinity,
              repeatType: "loop",
            }}
          />
        ))}
      </svg>
    </div>
  );
}
